import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

//Bootstrap stuff

var Button = require('react-bootstrap/lib/Alert');

class App extends Component {
  render() {

    return (
      <div className="App">
        <img id="prippan" src={require('./media/pripps.jpg')} />
        <Button>Aff</Button>
      </div>
    );
  }
}

export default App;
